    if text_index == len(text) and pat_index != len(pat):
        return 0
    # Else If last character of pattern reaches
    if pat_index == len(pat):
        return 1
    if text[text_index] == pat[pat_index]:
        return exactMatch(text, pat, text_index+1, pat_index+1)
    return 0
